import {AppRegistry} from 'react-native';
import App from './App';
import {m_physics as m_physics} from './app.json';
import { gestureHandlerRootHOC } from 'react-native-gesture-handler'

AppRegistry.registerComponent(m_physics, () => gestureHandlerRootHOC(App));
